// ==UserScript==
// @name         Protonize DuckDuckGo
// @namespace    http://tampermonkey.net/
// @version      2025-07-25
// @description  Give DuckDuckGo Proton branding
// @author       bumpysardines
// @updateURL    https://github.com/bumpysardines/Protonize-DuckDuckGo/main/ProtonDDG.js
// @downloadURL  https://github.com/bumpysardines/Protonize-DuckDuckGo/main/ProtonDDG.js
// @match        *://www.duckduckgo.com/*
// @include       http://duckduckgo.com/*
// @include       https://duckduckgo.com/*
// @include       http://*.duckduckgo.com/*
// @include       https://*.duckduckgo.com/*
// @icon         data:image/png;base64,
// @grant        GM_addStyle
// @run-at       document-end
// ==/UserScript==

(function() {
    'use strict';

    var duckduckgo_homepage_logo = "data:image/png;base64,";
    var duckduckgo_search_logo = "data:image/png;base64,";

    var ddghomepagelogo = document.getElementById("logo_homepage_link");
    var ddgsearchlogo = document.getElementsByClassName("header__logo");

    if(typeof(ddghomepagelogo) != 'undefined' && ddghomepagelogo != null){
        console.log("Changing homepage logo for DuckDuckGo!");
        ddghomepagelogo.style.backgroundImage = "url('" + duckduckgo_homepage_logo + "')";
    }
    if(typeof(ddgsearchlogo) != 'undefined' && ddgsearchlogo != null){
        console.log("Changing search logo for DuckDuckGo!");
        ddgsearchlogo[0].style.backgroundImage = "url('" + duckduckgo_search_logo + "')";
    }

    // Original code from: https://www.old.reddit.com/r/duckduckgo/comments/lozfxk/pimp_up_your_duckduckgo_page_with_these_themes/
const makeCookieData = (ddg_cookie_input) => {
    let ddg_json = {};
  const items = ddg_cookie_input.split(/[ ,]+/);
  items.forEach((item)=>{
    let parts = item.split('=');
    ddg_json[parts[0]] = parts[1];
  });
  return ddg_json;
}

// Iterates over JSON, and adds to browser cookie store
const setCookies = (ddg_json) => {
  Object.keys(ddg_json).forEach(function(key) {
    document.cookie=`${key}=${ddg_json[key]}`;
  });
}

// Paste your cookie data here
const ddg_cookie_input = `5=2; dcm=6; dcs=1; s=m; o=s; y=44475a; psb=-1; bj=1; be=0; bg=-1; u=1; 1=-1; aq=-1; ap=-1; ax=-1; ak=-1; ao=-1; au=-1; t=a; ae=d; a=a; 7=0e0d12; j=1b1632; 9=afa0ff; aa=9977ff; 8=fff; x=fff; 21=16141c; bc=1`;

// Call set cookies, passing in formated cookie data
setCookies(makeCookieData(ddg_cookie_input));

// All done, reload page for changes to take effect :)


window.addEventListener('load', function() {
var icon = document.querySelector('link[rel~="icon"]');
var copy = icon.cloneNode(!0);
copy.href = "data:image/png;base64,";
icon.parentNode.removeChild(icon);
document.head.appendChild(copy);
}, false);})();
